        private bool Validate(QuestionnaireScope scope)
        {
            if (scope.Entries.SelectMany(z => z.Answers.Select(h => h.Id)).Distinct().Count() == scope.Entries.SelectMany(z => z.Answers).Count())
                Console.WriteLine("Идентификаторы ответов на вопросы уникальные");
            else
                return false;
            if (scope.Entries.SelectMany(z => z.Answers.SelectMany(h => h.Mappings.Select(k => k.OutcomeIndex))).Distinct().Count() == scope.Outcomes.Count)
                Console.WriteLine("Все исходы связаны с ответами");
            else
                return false;
            return true;
        }

